import React, { Component } from 'react'
import styled from 'styled-components';


const Card = styled.div`
    width: 100%;
    height: 300px;  
`;

 class portfolioCard extends Component {


    render() {
    const {img, url, title, description} = this.props;

        return (
            <Card>
                <img src={url} />
            </Card>
        )
    }
}


export default portfolioCard;
